df['Ship Mode'].unique()

# Apagando valores nan:

# Renomeando colunas para snake_case:

df.columns.unique()

# Essa é uma forma de renomear, mas da muito trabalho, ao invez disso vamos fazer de outra forma:

# df.rename(columns = {'Order Id':'order_id',
#                       'Ship Mode':'ship_mode',
