#                       'Quantity':'quantity',
#                       'Discount Percent':'discount_percent'})

# Forma mais simples:

df.columns = df.columns.str.lower()
df.columns = df.columns.str.replace(' ', '_')
df.columns.unique()

# Criando uma nova coluna

# Com base nas colunas 'list_price' e 'discont_percent' vamos criar uma nova coluna:

df['discount'] = df['list_price'] * df['discount_percent']*.01 #(converte a porcentagem em valor decimal)
df.head()

# Vamos criar uma outra para o preço com desconto:

df['sale_price'] = df['list_price'] - df['discount']
df.head()

# Vamos criar uma para o lucro:

df['profit'] = df['sale_price'] - df['cost_price']
df.head()

# Convetendo os tipos:

# Ao avaliar os tipos das colunas, vemos que order_data na verdade é do tipo object, então vamos converter para o tipo data para datetime64[ns]:

df['order_date'] = pd.to_datetime(df['order_date'], format = '%Y-%m-%d')
df.dtypes

# Agora que ja temos a coluna de sale_price, não precisamos mais da de discount_percent, então vamos retirar ela:

df.drop(columns = ['discount'], inplace = True)
df.head()

